import React from "react";

export const PackCard = ({ opts }) => {
  const { name, includes, dealerPrice, retailPrice } = opts;
  return (
    <div>
      <h3>XPEL Ultimate Silver Package:</h3>
      <ul>
        <li>24 inch Hood & fenders</li>
        <li>Door cups & mirrors</li>
        <li>{`Front bumper (No Trim)`}</li>
      </ul>
      <h4>Dealer Price: $769.95</h4>
      <h4>Suggested Retail Price: $1399.95</h4>
    </div>
  );
};
